import ExerciseTargetForm from "./ExerciseTargetForm"
import ExerciseTargetCard from "./ExerciseTargetCard"
import { useEffect } from "react/cjs/react.development"

const NewExerciseTargetList = (newExerciseTargetList) => {
//an array of the exerciseTargetLists

    const exerciseTarget = console.log(newExerciseTargetList);

    // newExerciseTargetList.map(exerciseTarget => {
    //     // return <ExerciseTargetCard exerciseTarget = {exerciseTarget}/>
    //     return (
    //         <ExerciseTargetCard exercise={exerciseTarget}/>
    //     )
    // })

    useEffect(exerciseTarget, [newExerciseTargetList]);

    return (
        newExerciseTargetList.length > 0
        ?
        <>
        <p>display exerciseTargets</p>
        {exerciseTarget}</>
        :
        <>
        </>
    )
}
export default NewExerciseTargetList;
